	"sku": [
		{
			"id": "ELW-51D-34",
			"name": "Sapatilha Boxe Everlast Ring II ELW-51D-34",
			"description": "<p>Perfeito para as meninas que praticam&nbsp;boxe&nbsp;e querem ter um toque a mais de estilo em suas lutas, o&nbsp;T&ecirc;nis Everlast Ring II &ndash; Feminino&nbsp;&eacute; extremamente confort&aacute;vel e macio.<br \/><br \/>Possui cano alto que ajuda a proteger os seus p&eacute;s de maneira mais efetiva, o cal&ccedil;ado tem a sua parte superior externa feita em couro sint&eacute;tico, muito resistente e dur&aacute;vel.<\/p>\r\n<p>A lingueta &eacute; acolchoada em mesh, tipo de poli&eacute;ster com microfuros especiais, ela confere aoT&ecirc;nis Everlast Ring II mais ventila&ccedil;&atilde;o, o que deixa os seus p&eacute;s mais secos, arejados e saud&aacute;veis para encarar qualquer desafio.<\/p>\r\n<p>Amortecimento<br \/>A Everlast&nbsp;desenvolveu a entressola desse produto com EVA injetado na regi&atilde;o do cal&ccedil;anhar, &aacute;rea do seu corpo que mais recebe os choques. Al&eacute;m disso, a palmilha anat&ocirc;mica e remov&iacute;vel.<br \/>Sempre firme<br \/>Para que voc&ecirc; n&atilde;o escorregue e n&atilde;o fa&ccedil;a feio durante um momento decisivo de sua luta, o cal&ccedil;ado traz solado com borracha antiderrapante. O ajuste tamb&eacute;m ser&aacute; ideal: devido ao cadar&ccedil;o com uma tira em velcro, os seus p&eacute;s ter&atilde;o mais estabilidade, firmeza e encaixe preciso com o sapato. Aproveite j&aacute; para levar o seu!<br \/>&nbsp;<br \/><\/p>\r\n<p>Principais Caracter&iacute;sticas<br \/>Cabedal (parte superior externa): Em couro sint&eacute;tico<br \/>Entressola: Em EVA injetado na regi&atilde;o do calcanhar para maior absor&ccedil;&atilde;o dos impactos e prote&ccedil;&atilde;o<br \/>Solado: Em borracha antiderrapante&nbsp;<br \/>Lingueta: Macia e acolchoada em mesh (material de poli&eacute;ster com tramas abertas) que proporciona maor absor&ccedil;&atilde;o da transpira&ccedil;&atilde;o com prote&ccedil;&atilde;o e conforto<br \/>Palmilha: Anat&ocirc;mica, em EVA forrada e remov&iacute;vel, com refor&ccedil;o de amortecimento na base do calcanhar<br \/>Forro: Interno com refor&ccedil;o acolchoado em mesh no tornozelo<br \/>Ajuste: Cadar&ccedil;o sim&eacute;trico com &nbsp;refor&ccedil;o por tira em velcro, ponteira plastificada<br \/>Peso Aproximado: 260 g - Tam 37 (O peso varia de acordo com a numera&ccedil;&atilde;o) &nbsp;<br \/>&nbsp;<br \/>&nbsp;Dicas de Conserva&ccedil;&atilde;o e Limpeza&nbsp;<br \/>Limpe apenas com pano umedecido em &aacute;gua<br \/>Deixe secar &agrave; sombra<br \/>Para evitar odores, deixe em local seco e arejado por pelo menos 12 horas<\/p>",
